using { sap.common.CodeList } from '@sap/cds/common';

namespace fileManagement;

entity FilesMediaTypeCodeList : CodeList {
  @Common.Text : { $value: name, ![@UI.TextArrangement]: #TextOnly }
  key code : String(50);
}

entity Files {
  key ID: UUID;
  fileId: String(50) @assert.unique @mandatory;
  filename: String(255);
  mediaType: Association to FilesMediaTypeCodeList;
  fileContent: String;
}

using { fileManagement } from '../db/schema.cds';

service fileManagementSrv {
  @odata.draft.enabled
  entity Files as projection on fileManagement.Files;
}
